import {StyledTextInput, StyledLablel, StyledFormArea, StyledFormButton, Avatar, StyledTitle, colors} from './../components/Styles';

import Logo from './../assets/logo.png';

const Login = () => {
    return(
       <div>
           <StyledFormArea>
               <Avatar image={Logo}/>
               <StyledTitle size={30} color={colors.theme}>Member Loging</StyledTitle>

           </StyledFormArea>
       </div>
    )
}

export default Login;
